(11, 'Katina', '<p><img src=\"https://static.chus.vn/images/thumbnails/850/478/banner_brand/182/1264X711_123rtisan.png\" alt=\"\" width=\"850\" height=\"478\"></p>\n<p>Tiệm Bạc Minh T&acirc;m c&oacute; nền tảng truyền thống l&agrave;m kim ho&agrave;n qua nhiều thế hệ. Mỗi thế hệ đều c&oacute; phong c&aacute;ch thiết kế ri&ecirc;ng nhưng đến đời thứ 5, thương hiệu nhận ra những mẫu trang sức mang đậm bản sắc Việt Nam lu&ocirc;n đọng lại ấn tượng mạnh nhất trong l&ograve;ng nhiều người. Bởi lẽ đ&oacute; m&agrave; hiện tại, tiệm bạc tập trung v&agrave;o việc chế t&aacute;c trang sức bạc lấy cảm hứng từ những h&igrave;nh ảnh truyền thống thuần Việt, đầy ho&agrave;i niệm v&agrave; th&acirc;n thương đối với mỗi người.&nbsp;</p>\n<p>Tiệm Bạc Minh T&acirc;m sử dụng chất liệu bạc 95 v&agrave; bạc 99 chuẩn cao cấp, c&oacute; độ s&aacute;ng b&oacute;ng v&agrave; tinh xảo cao. Bạc được chế t&aacute;c bởi những nghệ nh&acirc;n l&agrave;nh nghề với kinh nghiệm l&acirc;u năm, đam m&ecirc; chế t&aacute;c kim ho&agrave;n thủ c&ocirc;ng. Qu&aacute; tr&igrave;nh thực hiện được người nghệ nh&acirc;n đ&uacute;c kết bằng l&agrave; kỹ thuật t&agrave;i ba v&agrave; t&igrave;nh y&ecirc;u s&acirc;u đậm tới qu&ecirc; hương, đất trời Việt.&nbsp;</p>\n<p>Những h&igrave;nh ảnh đ&oacute; th&acirc;n thuộc, gần gũi v&agrave; ch&acirc;n phương l&agrave; thế. Rồi qua nghệ thuật tạo t&aacute;c trang sức bạc của người l&agrave;m, chiếc n&oacute;n l&aacute; hay t&agrave; &aacute;o d&agrave;i được thổi v&agrave;o sức sống mới mang gi&aacute; trị nghệ thuật tuyệt mỹ, mang vẻ đẹp trường tồn d&ugrave; đứng trước v&ograve;ng xo&aacute;y thời gian h&agrave; khắc.</p>', 'http://localhost:8080/uploads/Nico,_nến_khắc_chữ,_scented_candle_cphm-xb.jpeg', 9, 3, 1, '2024-10-16 11:51:09', '2024-10-16 15:49:12');

